import React from 'react';
import './index.css';
import Navbar from './Navbar';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import '../node_modules/bootstrap/dist/js/bootstrap.bundle';
import myimg from '../src/images/myimg.jpg';

function Home() {
  return (
        <>
          <Navbar/>
          <div className="container-fluid">
             <div className="row">
                 <div className="col-10 mx-auto">
                 <div className="row">
                   <div className="col-md-6 pt-5 order-2 order-lg-1">
                     <h1>Grow your buisness with <strong>My team</strong></h1>
                     <h2 className='my-3'>we are the team of developers</h2>
                     <div className='mt-3'>
                        <a className="btn-get-started">Get Started</a>

                     </div>

                   </div>
                   <div className="col-lg-6 order-1 order-lg-2 header-img mt-3">
                      <img  src={myimg} alt="anand" className="img-fluid"/>
                        

                   </div>

                 </div>
                </div>
             </div>

          </div>
        
        </>

  );
}

export default Home;
